import React from "react";
import './style/Backstage.css'
import Stream from './Stream';
import './index.css';
import './polyfills';

import {
  SAMPLE_SERVER_BASE_URL,
  API_KEY,
  SESSION_ID,
  TOKEN
} from './config';


function BackstagePage(credentials){

  return(
      <div className="Backstage">
          <h4>BACKSTAGE</h4>
          <Stream credentials={credentials} />
      </div>

  );
}

fetch("/api")
    .then(data => data.json())
    .then(BackstagePage)
    .catch((err) => {
        console.error('Failed to get session credentials', err);
        alert('Failed to get opentok sessionId and token. Make sure you have updated the config.js file.');
    });

if (API_KEY && TOKEN && SESSION_ID) {
  renderApp({
    apiKey: API_KEY,
    sessionId: SESSION_ID,
    token: TOKEN,
  });
} else {
  fetch(SAMPLE_SERVER_BASE_URL + '/session')
    .then(data => data.json())
    .then(renderApp)
    .catch((err) => {
      console.error('Failed to get session credentials', err);
      alert('Failed to get opentok sessionId and token. Make sure you have updated the config.js file.');
    });
}

export default BackstagePage;
